import React, { useEffect, useState } from 'react'

function Patient() {
	const [detail, detailSet] = useState({})

	let getDetail = () => {
		fetch('/patient')
			.then((response) => response.json())
			.then((data) => detailSet(data))
	}

	useEffect(() => {
		getDetail()
	}, [])

	useEffect(() => {}, [detail])

	return (
		<div>
			<div className='patientDetail'>ID: {detail.patientid}</div>
			<div className='patientDetail'>Name: {detail.patientname}</div>
			<div className='patientDetail'>Age: {detail.patientage}</div>
		</div>
	)
}

export default Patient
